O falso pesadelo dos verdadeiros fascistas

Os esquerdistas dizem que viviam um "pesadelo" sob o governo Bolsonaro, e que agora "acabou". O "pesadelo" que os esquerdistas viviam tinha esses componentes principais:

- Queda nas taxas de desemprego;
- Queda de impostos;
- Queda dos índices de criminalidade;
- Queda da inflação;
- Queda do preço de remédios essenciais;
- Queda do preço da gasolina.

O "pesadelo" também incluía:

- Contas do governo em dia;
- Estatais dando lucro;
- População mais segura;
- Maiores investimentos no país;
- Grandes obras concluídas;
- Respeito ao dinheiro público;
- Menos lucro para os bancos;
- Incentivo ao empreendedorismo;
- Maior assistência social.

O causador do "pesadelo" foi um presidente que:

- Nunca roubou;
- Nunca mandou prender ou perseguir ninguém;
- Nunca censurou a imprensa;
- Nunca perseguiu minorias;
- Nunca auxiliou ditaduras;
- Nunca foi condenado e preso.

Para acabar com o "pesadelo", os esquerdistas criaram narrativas para transformar um presidente honesto e democrático em um "fascista"; libertaram um criminoso; fizeram eleições sujas e recolocaram o criminoso na cadeira presidencial. Fizeram tudo isso para que o "pesadelo" acabe e tudo volte ao que era nos governos lulopetistas, com:

- Aumento nas taxas de desemprego;
- Aumento de impostos;
- Aumento dos índices de criminalidade;
- Aumento da inflação;
- Aumento do preço de remédios essenciais;
- Aumento da gasolina.

Para que o "pesadelo" do governo Bolsonaro fique de vez no passado, o governo dos verdadeiros fascistas, que se iniciará em janeiro de 2023, também terá: 

- Censura seguida de multa e/ou prisão;
- Drenagem do nosso dinheiro para as ditaduras;
- Incentivo à criminalidade por meio de desencarceramento em massa e audiências de custódia;
- Preparação da vítima para uso do vagabundo, por meio do desarmamento civil;
- Incentivo ao narcotráfico;
- Enfraquecimento das polícias e das forças armadas;
- Roubo amplo e irrestrito nas estatais;
- Invasão de propriedades;
- Criação de uma guarda pretoriana.

Os esquerdistas não são apenas os verdadeiros fascistas, são, acima tudo, os maiores espíritos de porco que a humanidade já viu.
